import React from "react";
import { BrowserRouter as Router, Route, Redirect } from "react-router-dom";
import Users from "./user/pages/Users";

const App = () => {
  return (
    <Router>
      <>
        <Route path="/" exact>
          <Users />
        </Route>
        <Redirect to="/" />
        <h1>Let's stt!!!!!!!!!!!!!!!!!!</h1>
      </>
    </Router>
  );
};

export default App;
